import { Component } from "@angular/core";
import * as Zebra from "nativescript-print-zebra";
import * as appSettings from "application-settings";


@Component({
    selector: "my-app",
    templateUrl: "app.component.html",
})
export class AppComponent {
    public printId = "";
    public defaults = {
        'language': "", 'macAddress': ""
    };
    public myPrinter: any;
    private document: any;
    private currentPrint: any;
    discovery() {
        var discover = new Zebra.Discovery();
        let self = this;
        discover.searchBluetooth().then(function (printers) {
            console.log(printers);
            appSettings.setString('printer', printers[0].address);
            self.getPrinter();
        })
    }
    getPrinter() {
        if (appSettings.hasKey('printer')) {
            this.printId = appSettings.getString('printer', '');
            // this.printer();
        }

    }

    printer() {

        new Zebra.Printer({ address: this.printId, language: "CPCL", debugging: true }).then((curprinter) => {
            console.dir(curprinter);
            this.currentPrint = curprinter;

        })

    }

    printBoardingPass() {
        console.time("Printing");
        console.log("Creating document.");
        // Create a new document to print
        new Zebra.Printer({ address: this.printId, language: "CPCL", debugging: true }).then(function(curprinter){
            const document = curprinter.createDocument();
        // You can chain the document calls
        document
            .image('~/bagtag.jpg',0)
            // .alignment('center')
            // .text("")

            curprinter.print(document).then(function () {
                console.log("Printed");
                curprinter.close().then(function () {
                    console.log("close");
                    console.timeEnd("Printing");
                }).catch(function (err) {
                    // Technically instead of handling the error here, we could just return the promise
                    console.log("Printing Error: ", err);
                });
        }).catch(function (err) {
            // Technically instead of handling the error here, we could just return the promise
            console.log("Printing Error: ", err);
        });
       
        })
        
        
    }
}
